                    "dcrContent": {"Content":{"RelatedImage":{"$text":"Thailand","image":"","file":"iwov-resources/images/component-guide/travel/Asia/Asia6.jpg"},"Copy":"Some say that the best snorkeling and diving locations are found off the coast of Thailand in the waters of the Andaman Sea. You can also enjoy yourself at a secluded beach, and swim alongside manta rays, fish, and turtles. And if you're the type that likes to be on the move, you can set sail to the many Thai islands such as Koh Muk, Koh Rok, Phuket, and Phi Phi.","SpecialPrice":2500,"RegularPrice":2700,"Title":"The Southeast Asian Destination of Thailand","Summary":"With its spectacular sunsets, breath-taking temples, and warm hospitality, it's no surprise that the Kingdom of Thailand is a focal point of travel to Southeast Asia.","Code":"ASTD"}},
