                    "path": "templatedata/Product/SimplePromo/data/component-guide/Tanzania.xml",
                    "dcrContent": {"Content":{"RelatedImage":{"$text":"South Africa","image":"","file":"iwov-resources/images/component-guide/travel/Africa/Africa2.jpg"},"Copy":"An enchanting, diverse country, South Africa boasts a number of sights, ranging from wild game to some of the best beaches in the world. Kruger National Park is a must-see destination, as you get to experience the wilderness as it truly is. The Nelson Mandela bridge stands out for it simplistic beauty. The Apartheid Museum reminds visitors of this country's ignominious past, while also praises the triumph of human spirit in the face of adversity. Finally, visit the Johannesburg Botanic Garden to see species of flowers that you might not see anywhere else in the world.","SpecialPrice":3400,"RegularPrice":3700,"Title":"African Safari","Summary":"South Africa has always been a complex country, and now that its politics are getting caught up with the rest of the world, it's a great destination for travelers who seek new adventures.","Code":"AFTZ"}},
