                    "path": "templatedata/Product/SimplePromo/data/component-guide/Asia4.xml",
                    "dcrContent": {"Content":{"RelatedImage":{"$text":"Japan","image":"","file":"iwov-resources/images/component-guide/travel/Asia/Asia8.jpg"},"Copy":"Take a train from the airport into downtown Tokyo where you can visit one of the most bustling cities in the world. Be sure to visit all the places you've read about and always wanted to visit: Mount Fuji, Nagano, Osaka, Nagasaki, and Hiroshima. And be sure to visit the peace memorial museum in Hiroshima, where you will be humbled by a community who aspire for peace due to their war-torn past.","SpecialPrice":2700,"RegularPrice":2900,"Title":"The Land of the Rising Sun","Summary":"A visit to Japan is often quite a thrill for visitors from outside of Asia. There are many things to see and do, mosty\ton the main island of Honshu, from Tokohu in the Northeast to Chugoku in the Southwest.","Code":"ASID"}},
