                    "dcrContent": {"Content":{"RelatedImage":{"$text":"Switzerland","image":"","file":"iwov-resources/images/component-guide/travel/Northern%20Europe/EU1.jpg"},"Copy":"Sometimes considered the most beautiful capital city in the world, Bern is not your typical European city. With only 130,000 residents, the town takes a very easy and relaxed perspective on life. Between the architecture, the landscapes, and the river, you will want to take as many pictures as possible while you're here.","SpecialPrice":3500,"RegularPrice":3800,"Title":"Charming Bern","Summary":"Bern is a city straight out of the fairy tales you heard when you were a child. Visit this tiny city and marvel at how a location so remote can seem so familiar.","Code":"NEEU"}},
