                    "path": "templatedata/Product/SimplePromo/data/component-guide/Asia3.xml",
                    "dcrContent": {"Content":{"RelatedImage":{"$text":"The Remote Regions of China","image":"","file":"iwov-resources/images/component-guide/travel/Asia/Asia3.jpg"},"Copy":"One would think a distant town would also be a quiet and sleepy one. Not so in Pingyao. The streets are filled with chatter, as you walk by many people who are eating, drinking, shopping, talking, or all of the above. Pingyao also has a wall, much small than The Great Wall, but still a site to behold. Climb to the top to get an amazing panoramic view of the entire city.","SpecialPrice":2300,"RegularPrice":2600,"Title":"The Remote Regions of China","Summary":"Come see the architecture, the relics, and the people of remote cities like Pingyao","Code":"ASMO"}},
